import { Component } from '@angular/core';

@Component({
  selector: 'app-home',
  templateUrl: './home.component.html',
  styleUrls: ['./home.component.css']
})
export class HomeComponent {
  constructor(private api : ApiService) {

  }
  getUser(){
    this.api.getUser()
    .subscribe({
      next:(res) => {
        console.log(res)
      },
      error: (err) => {
        alert("Something went wrong....")
      }
    })
  }
}
